import React, {useEffect, useState} from 'react'
import {View} from "react-native";

export default function MathsGroupScreen() {
    const [messages, setMessages] = useState([])

    useEffect(() => {
        setMessages([
            {
                _id: 1,
                text: 'Hello hi',
                createdAt: new Date(),
                user: {
                    _id: 2,
                    name: 'React Native',
                    avatar: "https://zupimages.net/up/22/01/nu7y.jpeg",
                },
            },
        ])
    }, [])

    return (
        <View>

        </View>
    )
}
